app.get('/api/teams/:id', (req, res) =>{
    console.log(req.params.id);

    TeamModel.findById(req.params.id, (err, data) => {
        res.json(data);
    })
})

app.put('/api/teams/:id', (req, res) => {
    console.log("Update Team: "+req.params.id);
    console.log(req.body);

    TeamModel.findByIdAndUpdate(req.params.id, req.body, {new:true}, 
        (err, data) => {
            //send the data back
            res.send(data);
        })
})

app.post('/api/teams', (req, res)=> {
    console.log("Team Recieved!");
    console.log(req.body.name);
    console.log(req.body.founded);
    console.log(req.body.crest);

    TeamModel.create({
        name:req.body.name,
        founded:req.body.founded,
        crest:req.body.crest
    })

    res.send("item added");
})

app.delete('/api/teams/:id', (req, res) =>{
    console.log("Delete Team: "+ req.params.id);

    TeamModel.findByIdAndDelete(req.params.id, (err, data) => {
        res.send(data);
    })
})

